INSERT INTO `consultasclientes` VALUES (1,'Listado 1','Consulta que devuelve el contacto, tel‚Äöfono, celular, direcci¬¢n y tareas asignadas de todos los servicios','select Nombre, PersonaContacto as Contacto, Telefonos, Celular, Direccion, TareasAsignadas from servicios',1),(2,'Listado 2','Consulta que devuelve la raz¬¢n social, el RUT, el nombre fantas¬°a, el d¬°a de cobro, tel‚Äöfono, celular, nombre para cobrar','select c.Nombre, c.RUT, c.NombreFantasia, s.DiaCobro, s.Telefonos, s.Celular, s.NombreCobrar from clientes c, servicios s where s.NumeroCliente=c.NumeroCliente',1),(3,'Listado de Escalafon Diario','Lista el Servicio, HoraConfirmacion, HoraEntrada, HoraSalida, Funcionario y CelularEnConvenio en la fecha ingresada.','select cli.Nombre as Cliente,ser.Nombre as Servicio,date_format(date_add(hge.HoraEntrada,INTERVAL -escemp.HsLlamadaAntesHoraInicio HOUR), \'%H:%i\') as HoraLlamada, date_format(hge.HoraEntrada, \'%H:%i\') as HoraEntrada,date_format(hge.HoraSalida, \'%H:%i\') as HoraSalida,emp.Nombre, emp.Apellido, emp.CelularenConvenio from EscalafonEmpleado escemp, Empleados emp,horasgeneradasescalafon hge, Clientes cli, Servicios ser where emp.NroEmpleado = hge.NroEmpleado and hge.FechaCorrespondiente=\'FECHA\' and hge.HoraEntrada is not null and hge.HoraSalida is not null and escemp.NroEmpleado=hge.NroEmpleado and escemp.IdEscalafon=hge.NumeroCliente*1000+hge.NumeroServicio and cli.NumeroCliente=hge.NumeroCliente and ser.NumeroCliente = hge.NumeroCliente and ser.NumeroServicio = hge.NumeroServicio',1),(4,'Motivos de Cambios Diarios en los Escalafones','Lista los Motivos de los Cambios realizados en el Control Diario para la fecha Ingresada','select DATE(mcd.Fecha) as Fecha,cli.Nombre as Cliente,ser.Nombre as Servicio,mcd.NroEmpleado,emp.Nombre,emp.Apellido,tmcd.descripcion,mcd.Observaciones from Clientes cli, Servicios ser, empleados emp, motivoscambiosdiarios mcd, tiposmotivocambiodiario tmcd where DATE(mcd.Fecha)=\'FECHA\' and emp.NroEmpleado= mcd.NroEmpleado and tmcd.IdTipoMotivo=mcd.IdTipoMotivo and cli.NumeroCliente=mcd.NumeroCliente and ser.NumeroCliente = mcd.NumeroCliente and ser.NumeroServicio = mcd.NumeroServicio',1);
