INSERT INTO `consultasempleados` VALUES (22,'PERSONAL JORNALERO ACTIVO','Consulta que devuelve la CI, Apellidos, Nombres, FechaNacimiento, FechaIngreso, NumeroEmpleado, Cargo, ValorHora y el Turno de todos los empleados jornaleros activos.','select @rownum:=@rownum+1 AS Nro, emp.NumeroDocumento, emp.Apellido, emp.Nombre, emp.FechaNacimiento, emp.FechaIngreso, emp.NroEmpleado, c.Nombre as Cargo, emp.ValorHora, emp.ServicioActual, emp.Turno from (SELECT @rownum:=0) r, empleados emp, TiposCargos c where emp.Activo=1 and emp.IdCargo = c.IdCargo and c.TipoFacturacion=\'JORNALERO\'',1),(23,'PERSONAL MENSUAL ACTIVO','Consulta que devuelve la CI, Apellidos, Nombres, FechaNacimiento, FechaIngreso, NumeroEmpleado, Cargo, ValorHora y el Turno de todos los empleados MENSUALES activos.','select @rownum:=@rownum+1 AS Nro, emp.NumeroDocumento, emp.Apellido, emp.Nombre, emp.FechaNacimiento, emp.FechaIngreso, emp.NroEmpleado, c.Nombre as Cargo, emp.ServicioActual, emp.Turno from (SELECT @rownum:=0) r, empleados emp, TiposCargos c where emp.Activo=1 and emp.IdCargo = c.IdCargo and c.TipoFacturacion=\'MENSUAL\'',1),(24,'LISTADO DE TELEFONOS DE PERSONAL JORNALERO ACTIVO','Consulta que devuelve el NumeroEmpleado, CelularConvenio, NumeroDocumento, Apellidos, Nombres, ServicioActual y Turno de todos los empleados JORNALEROS activos.','select @rownum:=@rownum+1 AS Nro, NroEmpleado, CelularenConvenio, NumeroDocumento, Apellido, empleados.Nombre, ServicioActual, Turno from (SELECT @rownum:=0) r, empleados , tiposcargos where empleados.Activo=1 and tiposcargos.idCargo=empleados.idCargo and tiposcargos.TipoFacturacion=\'JORNALERO\'',1),(25,'EGRESOS PARA LIQUIDAR PARA UN DIA DE PAGO','Consulta que devuelve el CI, Apellidos, Nombres, FechaNacimiento, FechaIngreso, FechaBaja, NumeroEmpleado, Cargo, ValorHora y el Turno de todos los empleados JORNALEROS activos.','select @rownum:=@rownum+1 AS Nro, emp.NumeroDocumento, emp.Apellido, emp.Nombre, emp.FechaNacimiento, emp.FechaIngreso, emp.FechaBaja, emp.NroEmpleado, c.Nombre as Cargo, emp.ValorHora, emp.Turno from (SELECT @rownum:=0) r,  empleados emp, tiposcargos c where emp.Activo=0 and c.IdCargo=emp.idCargo and FechaPrevistaPago=\'FECHA\'',1),(26,'PERSONAL LIQUIDADAS Y NO COBRARON','Consulta que devuelve el CI, Apellidos, Nombres, FechaNacimiento, FechaIngreso, NumeroEmpleado, Cargo, ServicioActual, Turno y FechaBaja de todos los empleados dados de Baja pero que tienen para liquidar el Egreso.','select  @rownum:=@rownum+1 AS Nro, emp.NumeroDocumento, emp.Apellido, emp.Nombre, emp.FechaNacimiento, emp.FechaIngreso,  emp.NroEmpleado, c.Nombre as Cargo, emp.ServicioActual, emp.Turno, emp.FechaBaja, emp.FechaPrevistaPago from (SELECT @rownum:=0) r,  empleados emp, tiposcargos c where emp.Activo=0 and c.IdCargo=emp.idCargo and FechaPrevistaPago<now() and FechaPagoEfectuado is null',1),(27,'CONSULTA RENAEMSE','Consulta que devuelve Nro Correlativo - Apellido - Nombre - Cargo - ServicioActual - Turno - CI - FechaTestPsicologico - FechaAprobacionCurso(Dia Anterior al Ingreso) -  CursoServicioArmado(SI/NO) - EnServicioArmado(SI/NO) - CAJ_Numero - CertificadoDomicilio(SI/NO) para todos los empleados ACTIVOS.','select @rownum:=@rownum+1 AS Nro, emp.Apellido AS Apellidos, emp.Nombre AS Nombres, c.Nombre AS Cargo, emp.ServicioActual,emp.Turno, emp.NumeroDocumento, emp.FechaTestPsicologico, ADDDATE(emp.FechaIngreso, -1) AS FeachaAprobCurso,emp.CapacitadoPortarArma AS CursoServicioArmado, emp.EnServicioArmado AS EnServicioArmado, emp.CAJ_Numero, emp.ConstanciaDomicilio AS ConstanciaDomicilio from (SELECT @rownum:=0) r, empleados emp, tiposcargos c where emp.Activo=1 AND c.IdCargo=emp.IdCargo',1),(28,'BAJAS SIN FECHA DE PAGO PREVISTO','Devuelve el Apellido, Nombre, CI, NroEmpleado, FechaIngreso, FechaEgresoy la Diferencia en dias de las fechas de los empleados inactivos.','select @rownum:=@rownum+1 as Nro, Apellido, Nombre, NumeroDocumento, FechaIngreso, FechaBaja, DATEDIFF(FechaBaja ,FechaIngreso) as DiasDiferencia from  (SELECT @rownum:=0) r, empleados where Activo=0 and FechaPrevistaPago is null and FechaBaja>=\'FECHA\'',1);
/*!40000 ALTER TABLE `consultasempleados` ENABLE KEYS */;
UNLOCK TABLES;

